		<iframe src="https://www.youtube.com/embed/C-YKvC2r-Xk?rel=0&controls=0&disablekb=1" frameborder="0" allowfullscreen class="yt" allow="autoplay"></iframe>
	</div>

	<script>
		function playVideo() {
            const videoFrame = document.querySelector('.video-container');
            const video = document.getElementsByClassName("yt")[0]
            videoFrame.style.display = 'block';
            video.src += "&autoplay=1";
		}
	</script>
</body>
</html>
